import React from "react";
import Artist from "./Artist";

const ArtistList = (props) => {
  return (
    <div>
      {props.artists.map((artist) => (
        <ul key={artist.id}>
          <Artist 
            name={artist.name}
            followers={artist.followers.total}
            genres={artist.genres}
            link={artist.href}
            images={artist.images}
          />
        </ul>
      ))}
    </div>
  );
};

export default ArtistList;
